class Pokedata {
    constructor(nom, atk, atkSpe, def, defSpe, hp, type, id, speed, weight, height) {
      this.nom = nom;
      this.atk = atk;
      this.atkSpe = atkSpe;
      this.def = def;
      this.defSpe = defSpe;
      this.hp = hp;
      this.type = type;
      this.atidk = id;
      this.speed = speed;
      this.weight = weight;
      this.height = height;
    }
  }
